import React from 'react'
import Header from '../components/Header'
import Footer from '../components/Footer'
import { Container } from 'react-bootstrap';

function About(){
    return(
        <>
            <Header sitename={"My react-app"}/>
            <section>
                <Container>
                    <Row></Row>
                </Container>
            </section>
            <Footer/>
        </>
    )
}

export default About;
